import React from 'react';
import { Grid,Typography,Button } from '@mui/material';
import { styled } from '@mui/material/styles'

const ColorButton = styled(Button)(({ theme }) => ({
  color: '#FFFFF',
  backgroundColor: purple[500],
  '&:hover': {
    backgroundColor: purple[700],
  },
}));

export default function Home() {
  return (
    <Grid container columns={1}>
      <Grid item  sx={{ bgcolor: '#cfe8fc', height: '25rem', width:'100%', textAlign: 'center'}}>
        <Typography variant='h2' gutterBottom sx={{fontWeight:'bold', color:'#FFFFFF'}}>
          Eden's Garden
        </Typography>
        <Typography variant='subtitle1' sx={{ color:'#FFFFFF'}}>
          Every year, the US wastes about 40% of the food it produces.
        </Typography>
        <Typography variant='subtitle1' sx={{ color:'#FFFFFF'}}>
          Meanwhile, over 41 million people in the US face hunger.
        </Typography>
        <Typography variant='subtitle1' sx={{marginBottom:'3rem', color:'#FFFFFF'}}>
          At Eden's Garden, We make sure this doesn't happen
        </Typography>
        <Button variant='contained' sx={{color:'#FFFFFF', borderColor:'#FFFFFF'}}>Help Us</Button>
      </Grid>
      <Grid item justifyItems="center" alignItems="center" sx={{ bgcolor: '#f32432', height: '25rem', width:'100%'}}>
      </Grid>
    </Grid>
  );
}
